webpackJsonp([1242],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-arrayprototypepush.json":function(e,r){e.exports={data:{markdownRemark:{html:"<p>The JavaScript array method <code>.push()</code> adds one or more new elements to the end of an array and returns the length of the newly expanded array.</p>\n<p><strong>Syntax</strong></p>\n<pre><code>var array = [1, 2, 3, 4, 5];\narray.push(6);\n</code></pre>\n<h2>Parameters</h2>\n<p><code>.push</code> accepts one or multiple parameters.</p>\n<h2>Returns</h2>\n<p>The length of the array is returned by <code>.push()</code></p>\n<h2>Description</h2>\n<p><code>.push()</code> 'pushes' new values onto the end (the right side) of an array.</p>\n<h2>Examples</h2>\n<p><strong>Pushing a new element into an array</strong></p>\n<pre><code>var array = [1, 2, 3, 4, 5];\nvar totalArrayElements = array.push(6);\n\nconsole.log(array);\n// Console will output 1, 2, 3, 4, 5, 6\n\nconsole.log(totalArrayElements);\n// Console will output 6\n</code></pre>\n<p>Source <a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/push\">MDN</a></p>",frontmatter:{title:"Array.prototype.push",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-arrayprototypepush/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-arrayprototypepush/"}}}});
